  "inlineSchema": "// Prisma schema for CoFARS E-commerce\n\ngenerator client {\n  provider = \"prisma-client-js\"\n}\n\ndatasource db {\n  provider = \"postgresql\"\n  url      = env(\"DATABASE_URL\")\n}\n\n// User model with segmentation\nmodel User {\n  id       String   @id @default(uuid())\n  email    String   @unique\n  password String\n  name     String\n  phone    String?\n  role     UserRole @default(USER)\n\n  // User segmentation for CoFARS\n  segment          UserSegment @default(COLD_START)\n  interactionCount Int         @default(0)\n\n  // Timestamps\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  orders       Order[]\n  cart         CartItem[]\n  reviews      Review[]\n  interactions UserInteraction[]\n  preferences  UserPreference?\n\n  @@index([email])\n  @@index([segment])\n}\n\nenum UserRole {\n  USER\n  ADMIN\n}\n\nenum UserSegment {\n  COLD_START // 1 interaction\n  REGULAR // 2-4 interactions\n  POWER // >=5 interactions\n}\n\n// Product catalog\nmodel Product {\n  id          String  @id @default(uuid())\n  name        String\n  description String  @db.Text\n  price       Decimal @db.Decimal(10, 2)\n  category    String\n  group       String // Main category for JS divergence\n\n  // Product attributes for recommendations\n  priceBucket Int // 1-5 (Low to High)\n  ratingLevel Int // 1-3 (Low/Medium/High)\n\n  // Inventory\n  stock    Int      @default(0)\n  imageUrl String?\n  images   String[] // Array of image URLs\n\n  // Metadata\n  isActive  Boolean  @default(true)\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  orderItems   OrderItem[]\n  cartItems    CartItem[]\n  reviews      Review[]\n  interactions UserInteraction[]\n\n  @@index([category])\n  @@index([group])\n  @@index([priceBucket])\n  @@index([isActive])\n}\n\n// Shopping cart\nmodel CartItem {\n  id        String @id @default(uuid())\n  userId    String\n  productId String\n  quantity  Int    @default(1)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  user    User    @relation(fields: [userId], references: [id], onDelete: Cascade)\n  product Product @relation(fields: [productId], references: [id], onDelete: Cascade)\n\n  @@unique([userId, productId])\n  @@index([userId])\n}\n\n// Orders\nmodel Order {\n  id     String @id @default(uuid())\n  userId String\n\n  // Order details\n  status OrderStatus @default(PENDING)\n  total  Decimal     @db.Decimal(10, 2)\n\n  // Shipping\n  shippingAddress String @db.Text\n  shippingPhone   String\n\n  // Context at order time (for recommendations)\n  contextId Int? // Context when order was placed\n  timeSlot  String? // morning, afternoon, evening, late_night, unknown\n  isWeekend Boolean?\n\n  // Timestamps\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  user  User        @relation(fields: [userId], references: [id])\n  items OrderItem[]\n\n  @@index([userId])\n  @@index([status])\n  @@index([createdAt])\n}\n\nenum OrderStatus {\n  PENDING\n  CONFIRMED\n  PROCESSING\n  SHIPPED\n  DELIVERED\n  CANCELLED\n}\n\nmodel OrderItem {\n  id        String  @id @default(uuid())\n  orderId   String\n  productId String\n  quantity  Int\n  price     Decimal @db.Decimal(10, 2)\n\n  order   Order   @relation(fields: [orderId], references: [id], onDelete: Cascade)\n  product Product @relation(fields: [productId], references: [id])\n\n  @@index([orderId])\n}\n\n// Product reviews\nmodel Review {\n  id        String  @id @default(uuid())\n  userId    String\n  productId String\n  rating    Int // 1-5\n  comment   String? @db.Text\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  user    User    @relation(fields: [userId], references: [id], onDelete: Cascade)\n  product Product @relation(fields: [productId], references: [id], onDelete: Cascade)\n\n  @@unique([userId, productId])\n  @@index([productId])\n  @@index([rating])\n}\n\n// User interactions for recommendation model\nmodel UserInteraction {\n  id        String @id @default(uuid())\n  userId    String\n  productId String\n\n  // Interaction type\n  type InteractionType\n\n  // Context information\n  contextId Int?\n  timeSlot  String?\n  isWeekend Boolean?\n\n  // Timestamps\n  timestamp DateTime @default(now())\n\n  user    User    @relation(fields: [userId], references: [id], onDelete: Cascade)\n  product Product @relation(fields: [productId], references: [id])\n\n  @@index([userId])\n  @@index([productId])\n  @@index([timestamp])\n  @@index([contextId])\n}\n\nenum InteractionType {\n  VIEW\n  CART_ADD\n  PURCHASE\n  REVIEW\n}\n\n// User preferences\nmodel UserPreference {\n  id     String @id @default(uuid())\n  userId String @unique\n\n  // Preferred categories\n  favoriteCategories String[]\n\n  // Price range preference\n  minPrice Decimal? @db.Decimal(10, 2)\n  maxPrice Decimal? @db.Decimal(10, 2)\n\n  // Notification settings\n  emailNotifications Boolean @default(true)\n\n  updatedAt DateTime @updatedAt\n\n  user User @relation(fields: [userId], references: [id], onDelete: Cascade)\n}\n\n// Context prototypes (cached from ML model)\nmodel ContextPrototype {\n  id        Int     @id // 0-9 for 10 contexts\n  name      String // e.g., \"morning_weekday\"\n  timeSlot  String // morning, afternoon, evening, late_night, unknown\n  isWeekend Boolean\n\n  // Cached embeddings (JSON)\n  embedding String? @db.Text\n\n  // Statistics\n  interactionCount Int @default(0)\n\n  updatedAt DateTime @updatedAt\n\n  @@unique([timeSlot, isWeekend])\n}\n\n// Recommendation cache\nmodel RecommendationCache {\n  id        String @id @default(uuid())\n  userId    String\n  contextId Int\n\n  // Cached recommendations (product IDs)\n  productIds String[] // Array of product IDs\n  scores     Float[] // Corresponding scores\n\n  // Cache metadata\n  createdAt DateTime @default(now())\n  expiresAt DateTime\n\n  @@unique([userId, contextId])\n  @@index([userId])\n  @@index([expiresAt])\n}\n",
